import React from 'react';
import Form from './Form';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Nav,
  NavItem,
  Dropdown,
  DropdownItem,
  DropdownToggle,
  DropdownMenu,
  NavLink,
} from 'reactstrap';

const Home = () => {
  return (
    <div>
      <Nav pills>
        <NavItem>
          <NavLink href='#'>Add check</NavLink>
        </NavItem>
        <NavItem>
          <NavLink href='#'>See results</NavLink>
        </NavItem>
      </Nav>
    </div>
  );
};

export default Home;
